import React from 'react';
import { Section, Row, Col, TextInput, Icon, Button } from 'react-materialize';
import passport from 'passport';

export default function Register() {
  const emailRef = React.useRef();
  const passwordRef = React.useRef();
  const password2Ref = React.useRef();

  const onRegisterClick = () => {
    console.log(emailRef.current.value, passwordRef, password2Ref);
  };

  return (
    <Section className="container">
      <Row>
        <Col
          s={12}
          m={4}
          xl={4}
          offset="m4 xl4"
          className="z-depth-4 card-panel border-radius-6 register-card bg-opacity-8"
        >
          <div className="register-form">
            <Row>
              <h4 className="header center-align">Register</h4>
            </Row>
            <Row>
              <TextInput
                id="email"
                icon={<Icon>email</Icon>}
                ref={emailRef}
                label="Email"
                s={12}
              />
            </Row>
            <Row>
              <TextInput
                id="password"
                type="password"
                ref={passwordRef}
                icon={<Icon>lock_outline</Icon>}
                label="Password"
                s={12}
              />
            </Row>
            <Row>
              <TextInput
                id="password2"
                type="password"
                ref={passwordRef}
                icon={<Icon>lock_outline</Icon>}
                label="Repeat Password"
                s={12}
              />
            </Row>
            <Row>
              <Col s={12} className="input-field">
                <Button
                  waves="light"
                  className="col s12"
                  onClick={onRegisterClick}
                >
                  Register
                </Button>
              </Col>
            </Row>
          </div>
        </Col>
      </Row>
    </Section>
  );
}
